(629,	'quads_vi_settings',	'O:8:\"stdClass\":3:{s:6:\"status\";s:2:\"ok\";s:5:\"error\";N;s:4:\"data\";O:8:\"stdClass\":15:{s:9:\"signupURL\";s:41:\"https://www.vi.ai/publisher-registration/\";s:12:\"dashboardURL\";s:23:\"https://dashboard.vi.ai\";s:13:\"directSellURL\";s:46:\"https://www.vi.ai/publisher-video-monetization\";s:11:\"demoPageURL\";s:44:\"http://demo.vi.ai/ViewsterBlog_Nintendo.html\";s:8:\"loginAPI\";s:52:\"https://dashboard-api.vidint.net/v1/api/authenticate\";s:10:\"revenueAPI\";s:65:\"https://dashboard-api.vidint.net/v1/api/publishers/report/revenue\";s:8:\"jsTagAPI\";s:58:\"https://dashboard-api.vidint.net/v1/api/applications/jstag\";s:16:\"iabCategoriesURL\";s:55:\"https://docs.vi.ai/integrations/list-of-iab-categories/\";s:9:\"adsTxtAPI\";s:58:\"https://dashboard-api.vidint.net/v1/api/publishers/ads-txt\";s:20:\"setCookieAndRedirect\";s:45:\"https://dashboard-api-test.vidint.net/v1/scar\";s:13:\"vendorListURL\";s:21:\"https://vi.ai/vendors\";s:17:\"vendorListVersion\";s:1:\"1\";s:19:\"consentPopupContent\";O:8:\"stdClass\":3:{s:2:\"en\";s:241:\"<p>Click below to consent to the use of the cookie technology provided by vi (video intelligence AG) to personalize content and advertising. For more info please access <a target=\"_blank\" href=\"https://www.vi.ai/legals\">vi\'s website</a>.</p>\";s:2:\"fr\";s:263:\"<p>Pulse abajo para aceptar el uso de la tecnología de cookie proporcionada por vi (video intelligence AG) para personalizar el contenido y la publicidad. Para más información, acceda al<a target=\"_blank\" href=\"https://www.vi.ai/legals\"sitio web de vi</a>.</p>\";s:2:\"es\";s:288:\"<p>Cliquez ci-dessous pour accepter l\'utilisation de la technologie des cookies fournie par vi (video intelligence AG) pour personnaliser le contenu et la publicité. Pour plus d\'informations, veuillez accéder au <a target=\"_blank\" href=\"https://www.vi.ai/legals\">site web de vi</a>.</p>\";}s:8:\"purposes\";a:5:{i:0;O:8:\"stdClass\":3:{s:2:\"id\";i:1;s:4:\"name\";s:33:\"Storage and access of information\";s:11:\"description\";O:8:\"stdClass\":3:{s:2:\"en\";s:212:\"The storage of information, or access to information that is already stored, on your device such as accessing advertising identifiers and/or other device identifiers, and/or using cookies or similar technologies.\";s:2:\"de\";s:230:\"Speicherung von Informationen oder Zugriff auf Informationen, die bereits auf Ihrem Gerät gespeichert sind, z. B. Zugriff auf Werbe-IDs und / oder andere Geräte-IDs und / oder Verwendung von Cookies oder ähnlichen Technologien.\";s:2:\"fr\";s:259:\"Le stockage d\'informations ou l\'accès à des informations déjà stockées sur votre appareil, telles que l\'accès à des identifiants publicitaires et / ou à d\'autres identifiants d\'appareils, et / ou l\'utilisation de cookies ou de technologies similaires.\";}}i:1;O:8:\"stdClass\":3:{s:2:\"id\";i:2;s:4:\"name\";s:15:\"Personalisation\";s:11:\"description\";O:8:\"stdClass\":3:{s:2:\"en\";s:301:\"The collection and processing of information about your use of this site to subsequently personalize advertising for you in other contexts, i.e. on other sites or apps, over time. Typically, the content of the site or app is used to make inferences about your interests which inform future selections.\";s:2:\"de\";s:357:\"Die Sammlung und Verarbeitung von Informationen über Ihre Nutzung dieser Website, um die Werbung für Sie in anderen Kontexten, d. H. Auf anderen Websites oder in Apps, im Laufe der Zeit zu personalisieren. In der Regel wird der Inhalt der Website oder App verwendet, um Rückschlüsse auf Ihre Interessen zu ziehen, die zukünftige Auswahlen beeinflussen.\";s:2:\"fr\";s:379:\"La collecte et le traitement d\'informations sur votre utilisation de ce site pour ensuite personnaliser la publicité pour vous dans d\'autres contextes, c\'est-à-dire sur d\'autres sites ou applications, au fil du temps. En règle générale, le contenu du site ou de l\'application est utilisé pour faire des inférences sur vos intérêts qui éclairent les sélections futures.\";}}i:2;O:8:\"stdClass\":3:{s:2:\"id\";i:3;s:4:\"name\";s:33:\"Ad selection, delivery, reporting\";s:11:\"description\";O:8:\"stdClass\":3:{s:2:\"en\";s:525:\"The collection of information, and combination with previously collected information, to select and deliver advertisements for you, and to measure the delivery and effectiveness of such advertisements. This includes using previously collected information about your interests to select ads, processing data about what advertisements were shown, how often they were shown, when and where they were shown, and whether you took any action related to the advertisement, including for example clicking an ad or making a purchase. \";s:2:\"de\";s:576:\"Die Sammlung von Informationen und die Kombination mit zuvor gesammelten Informationen, um Werbung für Sie auszuwählen und zu liefern und die Lieferung und Wirksamkeit solcher Werbung zu messen. Dies beinhaltet die Verwendung zuvor gesammelter Informationen über Ihre Interessen zur Auswahl von Anzeigen, die Verarbeitung von Daten darüber, welche Werbeanzeigen gezeigt wurden, wie oft sie gezeigt wurden, wann und wo sie gezeigt wurden und ob Sie irgendwelche Maßnahmen im Zusammenhang mit der Werbung ergriffen haben, einschließlich z Anzeige oder einen Kauf tätigen.\";s:2:\"fr\";s:524:\"La collecte d\'informations, et la combinaison avec des informations précédemment collectées, pour sélectionner et livrer des publicités pour vous, et pour mesurer la livraison et l\'efficacité de ces publicités. Cela inclut l\'utilisation d\'informations précédemment collectées sur vos centres d\'intérêt pour sélectionner des publicités, le traitement des données affichées, la fréquence à laquelle elles ont été diffusées, le moment et l\'endroit où elles ont été diffusées. annonce ou faire un achat.\";}}i:3;O:8:\"stdClass\":3:{s:2:\"id\";i:4;s:4:\"name\";s:38:\"Content selection, delivery, reporting\";s:11:\"description\";O:8:\"stdClass\":3:{s:2:\"en\";s:495:\"The collection of information, and combination with previously collected information, to select and deliver content for you, and to measure the delivery and effectiveness of such content. This includes using previously collected information about your interests to select content, processing data about what content was shown, how often or how long it was shown, when and where it was shown, and whether the you took any action related to the content, including for example clicking on content. \";s:2:\"de\";s:550:\"Die Sammlung von Informationen und die Kombination mit zuvor gesammelten Informationen, um Inhalte für Sie auszuwählen und zu liefern und die Lieferung und Effektivität solcher Inhalte zu messen. Dies beinhaltet die Verwendung zuvor gesammelter Informationen über Ihre Interessen, um Inhalte auszuwählen, Daten darüber zu verarbeiten, welcher Inhalt gezeigt wurde, wie oft oder wie lange er angezeigt wurde, wann und wo er gezeigt wurde und ob Sie irgendwelche Maßnahmen in Bezug auf den Inhalt ergriffen haben zum Beispiel klicken auf Inhalt.\";s:2:\"fr\";s:527:\"La collecte d\'informations, et la combinaison avec des informations précédemment collectées, pour sélectionner et livrer du contenu pour vous, et pour mesurer la livraison et l\'efficacité de ce contenu. Cela inclut l\'utilisation d\'informations précédemment collectées sur vos centres d\'intérêt pour sélectionner du contenu, traiter le contenu affiché, combien de fois ou combien de temps il a été diffusé, quand et où il a été diffusé, et si vous avez pris des mesures par exemple en cliquant sur le contenu.\";}}i:4;O:8:\"stdClass\":3:{s:2:\"id\";i:5;s:4:\"name\";s:11:\"Measurement\";s:11:\"description\";O:8:\"stdClass\":3:{s:2:\"en\";s:185:\"The collection of information about your use of the content, and combination with previously collected information, used to measure, understand, and report on your usage of the content.\";s:2:\"de\";s:219:\"Die Sammlung von Informationen über Ihre Nutzung des Inhalts und die Kombination mit zuvor gesammelten Informationen, die verwendet werden, um Ihre Nutzung des Inhalts zu messen, zu verstehen und darüber zu berichten.\";s:2:\"fr\";s:213:\"La collecte d\'informations sur votre utilisation du contenu et la combinaison avec des informations précédemment collectées, utilisées pour mesurer, comprendre et rendre compte de votre utilisation du contenu.\";}}}s:9:\"languages\";a:3:{i:0;O:8:\"stdClass\":1:{s:5:\"en-us\";s:7:\"English\";}i:1;O:8:\"stdClass\":1:{s:5:\"de-de\";s:7:\"Deutsch\";}i:2;O:8:\"stdClass\":1:{s:5:\"fr-fr\";s:9:\"Français\";}}}}',	'yes'),
